$_MODULE['<{appagebuilder}prestashop>guide_e758db0a9312eeb625aa94a5529dafd6'] = 'Dieses Modul bietet eine Möglichkeit, mehr Website-Vorlagen erstellen Homepage, schnell ändern Sie Ihre Website, die Liste zeigt das Produkt, mehrere Widgets mit vielen verkaufenden Funktion für Ihren Shop (alle in einem).';
$_MODULE['<{appagebuilder}prestashop>guide_55c3c7f89c0bd6d1cc0bcbb0246cbd4e'] = 'Neues Profil erstellen';
$_MODULE['<{appagebuilder}prestashop>guide_a27ed6a695aa474957c9a650f9b86904'] = 'Sie können mehrere Profile erstellen, nur ein Profil, der Standard wird ausgelöst, wenn die Website veröffentlicht wird. Jedes Profil, das Sie anpassen können, die Schnittstelle, um unabhängig von einander zu ändern Website, JavaScript und CSS-Code, um hier direkt bearbeitet werden sollte flexibler.';
$_MODULE['<{appagebuilder}prestashop>guide_54cb3772ee4512ae0d6f85f846b3a7c7'] = 'So erstellen Sie einen neuen Profilbildschirm: Aus dem Menü auf der linken Seite \"Ap Manage Profile\" auf den nächsten Bildschirm listet Profil; Klicken Sie auf die Schaltfläche \"Neue hinzufügen\"';
$_MODULE['<{appagebuilder}prestashop>guide_0b7ccbc45a27df932564e298a1517fe6'] = 'Fügen Sie neue Widgets und Module hinzu, um Websites in einem Profil zu erstellen.';
$_MODULE['<{appagebuilder}prestashop>guide_1339273fae8c281aebfa708f299d4854'] = 'Dieses Modul liefert auch viele Widgets, um Funktionen für den Vertrieb, intuitive Benutzeroberfläche Flexibilität zu bauen. Auch integrieren Sie Ihre vorhandenen Module in diesem Modul, müssen Sie nur eine Website gebaut nur hier und schneller Seite zu bauen.';
$_MODULE['<{appagebuilder}prestashop>guide_47a7f937550e2076b96d3043911dd967'] = 'So erstellen Sie einen neuen Profilbildschirm: Aus dem Menü auf der linken Seite \"Ap Manage Profile\" auf den nächsten Bildschirm listet Profil; Klicken Sie in der Liste der Profile auf die Schaltfläche \"Ansicht\".';
